class Solution:
    def removeSubfolders(self, folder: List[str]) -> List[str]:
        folder.sort()
        ans = []
        for f in folder:
            flag = False
            for i, a in enumerate(ans):
                if f.startswith(a) and f != a:
                    ans = ans[:i] + ans[i+1:]
                    flag = True
                    break
            if not flag:
                ans.append(f)
        return ans
